<input type='text' size=6 id='txt3' value="龜"><input type='button' value='查字笔画' onclick="stroke();"><br>
<input type='text' size=6 id='txt1' value="50"><input type='button' value='每页字数' onclick="per_page();"><br>
<input type='text' size=6 id='txt2' value="500"><input type='button' value='字数限制' onclick="total_char();">

<script>
var findstr="";
var pages=0;
var perpage=50;
var totalchar=500;
function per_page()
{
	perpage=parseInt(txt1.value);
	if(perpage<=0)
		perpage=5;
}
function total_char()
{
	totalchar=parseInt(txt2.value);
	if(totalchar<=0)
		totalchar=5;
}
function stroke()
{
	if(txt3.value.length==0)
	{
		txt4.value="输入错误!";
		return;
	}
	var ss=txt3.value.substr(0,1);
	var re = new RegExp(","+ss+"[^,]*,","g");
	var str=strr
	mm=str.match(re)
	if(mm)
	{
		txt4.value=mm[0].substr(2,mm[0].length-3);
	}
	else
	{
		txt4.value="找不到!";
		return;
	}
}
function find_char(page,t)
{
	if(t==0)
	{
		var str=strr	
		if(txt.value.length==0)
		{
			dd.innerHTML="<font color=red><b>输入错误!";
			return;
		}
		ss=txt.value;
		ss=ss.replace(/\?/g,"[^,]")
		ss=ss.replace(/\*/g,"[^,]*")
		var re = new RegExp(",[^,]"+ss+",","g");
		
		mm=str.match(re)
		if(mm)
		{
			findstr="";
			pages=0;
			for(var i=0;i<mm.length && i<totalchar;i++)
			{
				findstr+=mm[i].substr(1,1);
			}			
		}
		else
		{
			dd.innerHTML="<font color=red><b>找不到!";
			return;
		}
		
		var t=findstr.length%perpage;
			
		if(t==0)
			pages=findstr.length/perpage;
		else
			pages=(findstr.length-t)/perpage+1;
		ttt.innerHTML="找到"+findstr.length+"字";
		find_char(1,1);return;
		
	}
	else
	{
		var s="";
		if(page!=1)
		{
			s="<a href='javascript:find_char("+(page-1)+",1)'>上页</a>&nbsp;";
		}
		else
		{
			s="上页&nbsp;";
		}
		s+=page+"/"+pages+"页&nbsp;";
		if(page!=pages)
		{
			s+="<a href='javascript:find_char("+(page+1)+",1)'>下页</a>";
		}
		else
		{
			s+="下页";
		}
		var disp=findstr.substr(perpage*(page-1),perpage);
		if(pages>1)
			dd.innerHTML=s+'<br><FONT COLOR=BLUE SIZE=15>'+disp+"</font><br>"+s;
		else
			dd.innerHTML='<br><FONT COLOR=BLUE SIZE=15>'+disp+"</font><br>";
		txt4.value=disp.substr(0,9);
	}
}
</script>
